                   window.phet.chipper.queryParameters.stringTest :

      return stringOverrides[ key ];
    }

    }

    var stringMap = null;

    for ( var locale of fallbackLocales ) {
      stringMap = phet.chipper.strings[ locale ];
      if ( stringMap ) {
        break;
      }
    }

    return phet.chipper.mapString( stringMap[ key ], stringTest );
  };
})();</script>
